// components/FormComponent4.js
// above form does not have rollnumber,date,



import React from 'react';
import {
  Box, Typography, Table, TableBody, TableCell,
  TableContainer, TableHead, TableRow, Paper
} from '@mui/material';

const FormComponent4 = ({
  title,
  subjectsData,
  idLabel,
  rollNumber,
  name,
  sod,
  examDate,
  sgpa // <-- Renamed from grandTotal
}) => {
  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h6" gutterBottom>
        {title}
      </Typography>

      {/* Student Info */}
      <Box sx={{ mb: 2 }}>
        <Typography><strong>{idLabel}:</strong> {rollNumber}</Typography>
        <Typography><strong>Name:</strong> {name}</Typography>
        <Typography><strong>S/o. / D/o.:</strong> {sod}</Typography>
        <Typography><strong>Month & Year of Exam:</strong> {examDate}</Typography>
      </Box>

      {/* Marks Table */}
      <TableContainer component={Paper} sx={{ mt: 2 }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#0a228a' }}>
              <TableCell sx={{ color: 'white' }}>S.No.</TableCell>
              <TableCell  sx={{ color: 'white' }} >Subject Code & Title</TableCell>
              <TableCell  sx={{ color: 'white' }}>Credits (C)</TableCell>
              <TableCell  sx={{ color: 'white' }}>Max. Marks (I.A / S.E)</TableCell>
              <TableCell  sx={{ color: 'white' }}>Marks Secured (I.A / S.E)</TableCell>
              <TableCell  sx={{ color: 'white' }}>Total Marks %</TableCell>
              <TableCell  sx={{ color: 'white' }}>Grade Secured</TableCell>
              <TableCell  sx={{ color: 'white' }}>Grade Point (G)</TableCell>
              <TableCell sx={{ color: 'white' }}>Credit Points (C×G)</TableCell>
              <TableCell  sx={{ color: 'white' }}>Result</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjectsData.map((subject, index) => (
              <TableRow key={index}>
                <TableCell>{index + 1}</TableCell>
                <TableCell>{subject.title}</TableCell>
                <TableCell>{subject.credits}</TableCell>
                <TableCell>{`${subject.maxIA} / ${subject.maxSE}`}</TableCell>
                <TableCell>{`${subject.marksIA} / ${subject.marksSE}`}</TableCell>
                <TableCell>{subject.percentage}</TableCell>
                <TableCell>{subject.grade}</TableCell>
                <TableCell>{subject.gradePoint}</TableCell>
                <TableCell>{subject.creditPoints}</TableCell>
                <TableCell>{subject.result}</TableCell>
              </TableRow>
            ))}

            {/* SGPA Row */}
            <TableRow>
              <TableCell colSpan={9} align="right"><strong>Semester Grade Point Average (SGPA):</strong></TableCell>
              <TableCell><strong>{sgpa}</strong></TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default FormComponent4;
